import React, { useState } from "react";
const App = () =>{
    const [name, setName]=useState();

    const inputevent=(event) =>{
        setName(event.target.value);
    }
    return(
    <>
        <div>
            <h1> Hello {name}</h1>
            <input type='text' 
            placeholder="Enter your name"
            onChange={inputevent}
            />
            <button> Click Me</button>
        </div>
    </>
    )
}
export default App;
